class testOf_huh_journal extends UnitTestCase { 
    function testConstructor() { 
       $t = new  huh_journal();
       $this->assertFalse($t->isLoaded());
       $this->assertFalse($t->isDirty());
       $this->assertIdentical($t->errorMessage(),'');
       $this->assertNull($t->getJournalID());
    } 
    function testKeys() { 
       $t = new  huh_journal();
